import React from 'react';
import '../index.css';


  function MyGrid() {
    const gridItems = [];

    for (let i = 0; i < 25; i++) {
      gridItems.push(
        <div className="box" key={i}>
          {generateRandomWord()}
        </div>
      );
    }
    return <div className="grid">{gridItems}</div>;
}

const CodeNames = () => {
    return (
      <div className="codenames">
        <h1>Code Names</h1>
        <body>
        <MyGrid />
        </body>

        <button> New Game</button>
        <button> Spymaster Mode</button>
      </div>
    );
  };


export default CodeNames;
